{'publishedAt': '2023-01-24T15:56:27Z', 'channelId': 'UCcL3WQrvv4gZ3VR5qFhE-zQ', 'title': 'BOLSONARO DEU R$ 872 MILHÕES A ONG EVANGÉLICA PARA CUIDAR DE INDÍGENAS E VETOU LEITOS E ÁGUA POTÁVEL', 'description': 'Em 6 de julho de 2020, Damares Alves, que exercia o cargo de ministra da Mulher, da Família e dos Direitos Humanos, pediu ao então presidente Jair Bolsonaro (PL) que não enviasse aos indígenas, que padeciam pela pandemia da covid-19, leitos de UTI, água potável, materiais de limpeza e higiene pessoal, ventiladores pulmonares e materiais informativos sobre a doença.

Nos quatro anos do governo do ex-presidente Jair Bolsonaro (PL), segundo os dados do Portal da Transparência, o Programa de Proteção e Recuperação da Saúde Indígena teve um orçamento de R$ 6,13 bilhões. No entanto, foram gastos somente R$ 5,44 bilhões.

De acordo com informações do jornal O Globo, a entidade que mais recebeu recursos foi uma ONG evangélica chamada Missão Caiuá. A ONG, sediada no Mato Grosso do Sul, recebeu R$ 872 milhões nesses quatro anos e diz “estar a serviço do índio para a glória de Deus”.', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/lZ4E9sIbE9s/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/lZ4E9sIbE9s/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/lZ4E9sIbE9s/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/lZ4E9sIbE9s/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/lZ4E9sIbE9s/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'TV Afiada', 'playlistId': 'UUcL3WQrvv4gZ3VR5qFhE-zQ', 'position': 236, 'resourceId': {'kind': 'youtube#video', 'videoId': 'lZ4E9sIbE9s'}, 'videoOwnerChannelTitle': 'TV Afiada', 'videoOwnerChannelId': 'UCcL3WQrvv4gZ3VR5qFhE-zQ'}

{'publishedAt': '2022-09-28T19:43:30Z', 'channelId': 'UCcL3WQrvv4gZ3VR5qFhE-zQ', 'title': 'ALEXANDRE DE MORAES FAZ GESTO DE DEGOLA EM SESSÃO, VIRALIZA NAS REDES SOCIAIS E É ATACADO', 'description': 'Um gesto feito pelo presidente do TSE, ministro Alexandre de Moraes, durante a sessão da Corte nesta terça-feira (28) tem repercutido e gerado especulações entre bolsonaristas nas redes sociais. 

No momento em que o tribunal julgava a possibilidade de o presidente Jair Bolsonaro (PL), candidato à reeleição, fazer "lives" com cunho eleitoral nas dependências do Palácio da Alvorada, Moraes passou o dedo indicador pelo pescoço, em um movimento comumente usado para se referir a algo que chegou ao fim — ou uma degola. 

O GLOBO apurou, porém, que Moraes, após dar a palavra à ministra Maria Claudia Bucchianeri, se dirigiu em tom de brincadeira a um assessor que estava no plenário do TSE. O motivo, segundo relatos feitos à reportagem, teria sido a demora para passar uma informação.', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/vdLHZe7sQ-o/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/vdLHZe7sQ-o/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/vdLHZe7sQ-o/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/vdLHZe7sQ-o/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/vdLHZe7sQ-o/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'TV Afiada', 'playlistId': 'UUcL3WQrvv4gZ3VR5qFhE-zQ', 'position': 482, 'resourceId': {'kind': 'youtube#video', 'videoId': 'vdLHZe7sQ-o'}, 'videoOwnerChannelTitle': 'TV Afiada', 'videoOwnerChannelId': 'UCcL3WQrvv4gZ3VR5qFhE-zQ'}

